class About extends Component {
    render() {
        return (
            <div className='container-fluid'>
                <hr />
                <h1 className='display-4'>About Me</h1>
                <hr />
                <p>I am <span id='para_name'>Arghya Sahoo</span>, a student of <span id='para_course'>Computer Science and Engineering</span> at Techno International Newtown. I am currently in 3rd Year. I am always learning new skills and building stuff</p>
            </div>
        );
    }
}

export default About;
